import React from 'react'
import styled, { keyframes } from 'styled-components';

 function Obs() {
     const moveOrb = keyframes`
        0% {
            transform: translate(0,0);
        }
        50% {
            transform: translate(400px,500px);
        }
        100% {
            transform: translate(0,0);
        }
          `;

   const OrbStyled = styled.div`
      width :70vh;
        height: 70vh;
        position: absolute;
        border-radius: 50%;
        margin-left:-37vh;
        margin-top:-37vh;
        background: linear-gradient(180deg, #4aaa7fff 0%, #7ff24aff 100%);
        filter: blur(100px);
        animation: ${moveOrb} 5s linear infinite;
         

      `;
  return (
    <OrbStyled></OrbStyled>
  )
}

export default Obs;
